Listing.where(title: "2005 Chrysler PT Cruiser", description: "Own a piece of time with our 2005 Chrysler PT Cruiser GT Convertible in Blue over Grey interior! This PT Cruiser's heartbeat comes from a Turbo Charged 2.4 Liter 4 Cylinder coupled to an Automatic transmission that delivers 220hp. This sassy little GT's 0 to 60 time, at 6.7 seconds, is more than four seconds quicker than the base engine models.   Owners love the ride of these PT Cruisers. Funny to say but it cruises like a dream! Check out the GT upgrades on this one! Check out our photos and list of features! Let the top down, sit back in the leather seats, hang on and get ready for some real fun!   Feel Safe behind the wheel with the long list of safety features! Print this page and call us Now... We Know You Will Enjoy You're Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 68037, transmission: "Automatic", color: "Electric Blue Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5999, newused: "Used", vin: "3C3AY75S25T335100", stocknumber: "ACSJ208", model: "PT Cruiser", trim: "GT", enginedescription: "2.4L 4 Cylinders", interiorcolor: "Dark Slate Gray", options: "Audio : Cd Player,Auxiliary Front/Rear/Center Console Pwr Outlets,Convenience : Adjustable Steering Wheel,Convenience : Fog Lamps,Convenience : Front Reading Lamps,Convenience : Intermittent Wipers,Convenience : Leather Steering Wheel,Convenience : Power Outlet,Convenience : Remote Trunk Release,Convenience : Security System,Convenience : Universal Garage Door Opener,Locks : Keyless Entry,Locks : Power Door Locks,Universal Garage Door Opener,Window : Power Windows", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: "Convertible", make: "Chrysler", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/177512/20180209000007612_DSC_0600.jpg", external_imagefront: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/177512/20180209000009262_DSC_0601.jpg", external_imageback: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/177512/20180209000004591_CCF08092017%20-%20Copy.jpg", external_imageleft: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/177512/20180209000006163_DSC_0602.jpg", external_imageright: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/177512/20180209000010841_DSC_0603.jpg", external_frontinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/177512/20180209000012414_DSC_0604.jpg", external_rearinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/177512/20180209000013966_DSC_0605.jpg").first_or_create
Listing.where(title: "2001 Chrysler PT Cruiser", description: "Our 2001 PT Cruiser Wagon with Clean Carfax combines the retro look of late-'30s American iron with modern performance, efficiency and features. It blends the retro look of the early American sedan with new-age styling cues such as dual-beam flush headlights and teardrop-shaped taillight lenses. This baby has leather seats, power sunroof, AM/FM stereo, CD player, cassette, and full floor carpeting!  This 4-door model's tall body boasts lots of room for people and cargo. In fact, its interior volume and versatility compare well to a small SUV. Fold the seats down and you can carry an eight-foot ladder. Pull the rear seats out and you can haul a load of building materials or a big-screen TV. Yet our PT Cruiser is small and easy to park. It's also easy on gas.  Our Cruiser is a great choice for people of all ages and lifestyles with its whimsical, retro design and functional attitude. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2001, miles: 98030, transmission: "Automatic", color: "Stone White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 3999, newused: "Used", vin: "3C8FY4BB61T593763", stocknumber: "ACSJ118", model: "PT Cruiser", trim: nil, enginedescription: "2.4L 4 Cylinders", interiorcolor: "Gray", options: "Air Conditioning : A/C,Air Conditioning W/Front & Rear Outlets,Audio : Am/Fm Stereo,Child Seat Anchor System,Convenience : Intermittent Wipers,Convenience : Power Outlet,Driver/Front Passenger Next Generation Airbags,Instrument Cluster W/Tachometer,Pwr Windows W/Driver & Front Passenger 1-Touch Down,Rear Door Child Protection Locks,Rear Window Defroster,Seats : Bucket Seats,Steering : Power Steering,Window : Power Windows,Window : Rear Defrost"