Listing.where(title: "2004 Dodge Durango", description: "Our 2004 Durango is dressed up in the ST trim and is more than capable of impressing every member your family as well as the neighbors! This one has a comparatively soft suspension, which translates to an especially comfortable ride. Power comes from a 4.7 liter V8 engine.  This Durango in the upscale ST trim, includes plenty for everyone to love! Our Durango is big and powerful with a nice, bold style. Yet, it's surprisingly refined. It's quiet, it rides smoothly, and its handling is stable and relatively agile.   How do you grab this one by the horns? Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2004, miles: 127864, transmission: "Automatic", color: "Bright White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4999, newused: "Used", vin: "1D4HD38N54F228168", stocknumber: "ECSJ337", model: "Durango", trim: "ST", enginedescription: "4.7L 8 Cylinders", interiorcolor: "Dk Khaki/Lt Graystone", options: "Audio : Am/Fm Stereo,Audio : Cd Player,Cargo Tie-Down Loops,Convenience : Intermittent Wipers,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Driver & Front Passenger Multistage Airbags,Front/Rear Pwr Outlet,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows W/Driver One-Touch,Seats : Bucket Seats,Seats : Rear Bench Seat,Window : Power Windows,Window : Privacy Glass", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, make: "Dodge", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176097/20180205181816049_d08a68e6e0e94e1c805f9debac40cb28.jpg", external_