Listing.where(title: "1998 Dodge Ram 1500", description: "This amazing 1998 Dodge Ram 1500 is just waiting to bring the right owner lots of joy and happiness. It will handle all the work tasks you need done, and do it with comfort and safety to spare. New Car Test Drive said, ...for cruising around town or going to the beach, the Ram offers loads of room, loads of power and loads of style  If you like pickups and the sound of V8 power with a 5.9L engine, you'll have a tough time walking away from this one. Tromping the gas produces a reassuring roar -- a reverberation of vitality. Otherwise, it's fairly quiet. Ride and handling are so competent that you almost forget you're in a full-size pickup. It has nice features like: automatic transmission, power steering, power brakes, and AM/FM/Cassette Audio System.   This 1998 Dodge Ram 1500 is not going to disappoint. Print This Page and Call Us Now! There you have it, short and sweet! Come see us today!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1998, miles: 148104, transmission: "Automatic", color: "Bright White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 3999, newused: "Used", vin: "1B7HC13Y7WJ257242", stocknumber: "HCSJ77", model: "Ram 1500", trim: nil, enginedescription: "5.2L 8 Cylinders", interiorcolor: "Mist Gray", options: "2-Spoke Steering Wheel,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Air Bag - Frontal : Passenger Air Bag On/Off Switch,Audio : Am/Fm Stereo,Cargo Lamp,Convenience : Intermittent Wipers,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Driver/Front Passenger \"Next Generation\" Air Bags W/Passenger On/Off Switch,Instrument Cluster-Inc: 120/125 Mph Primary Speedometer,Seats : Split Bench Seat,Shoulder Belt Height Adjusters,Side-Guard Door Beams,Steering : Power Steering", im