Listing.where(title: "2002 Ford Escape", description: "Our 2002 Clean Carfax Ford Escape XLT is known for its sporty yet rugged good looks and appeals to young families and people with active lifestyles. Powered by a 3.0-liter V6 that makes 200 hp and 200 lb-ft of torque, this four-wheel drive achieves nearly 20mpg on city streets and near 25mpg on the highway!  Our sporty SUV boasts an interior that is user friendly, has a long list of convenience features to make your drive a little more enjoyable, leather seating for five, sunroof and a more than generous amount of cargo room! Load 'em on up and hit the trails!  This Ford Escape delivers a smooth ride that handles great, it offers decent fuel economy and car-like qualities, plus feels nice and high off the road. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! END OF MARCH BOTTOM LINE CASH DEALS PRICES EXPIRE APRIL 1ST NO FOOLIN", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2002, miles: 147750, transmission: "Automatic", color: "Dark Highland Green Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4495, newused: "Used", vin: "1FMYU04192KA51655", stocknumber: "INSJ177", model: "Escape", trim: "XLT Choice", enginedescription: "3L 6 Cylinders", interiorcolor: "Tan", options: "Audio : Am/Fm Stereo,Child Safety Rear Door Locks,Convenience : Intermittent Wipers,Convenience : Luggage Rack,Convenience : Power Outlet,Convenience : Security System,Driver & Front Passenger Airbags,Locks : Keyless Entry,Locks : Power Door Locks,Seats : Bucket Seats,Seats : Rear Bench Seat,Securilock Passive Anti-Theft System W/Immobilizer,Side Door Intrusion Beams,Window : Power Windows,Window : Privacy Glass", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, ma