Listing.where(title: "2004 Ford F-150", description: "Our 2004 Ford F-150 STX SuperCab is a class leader when it comes to ride, handling and hauling capability. It benefits greatly from a redesign with a roomier cab, more power, and new styling and features. Under the hood is a powerful 4.6 Liter V8 that is connected to a very capable Automatic transmission that provides a smooth ride.   When you first sit in it, you'll wonder if you're really in a truck. The interior has an instrument panel that looks like it came out of a high-end luxury car. The sporty STX trim adds a body-colored grille surround for the black bar grille, the SuperCab allows for extra seating and storage room.   Safety features abound, you won't have to worry about your precious cargo. After spending about five minutes driving this truck, you'll be in love with it! Come on in so we can make this one yours! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2004, miles: 128936, transmission: "Automatic", color: "Blazing Yellow", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 9499, newused: "Used", vin: "1FTRX14W64KD60214", stocknumber: "LCSS87", model: "F-150", trim: "STX", enginedescription: "4.6L 8 Cylinders", interiorcolor: "Black", options: "3-Point Safety Belts At All Rear Seat Positions,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Air Conditioning : A/C,Audio : Am/Fm Stereo,Auto Lock Safety Belt Feature For Child Seats,Center Front Lap Belt,Convenience : Power Outlet,Dual Stage Driver & Front Passenger Airbags,Matching 60/40 Flip-Up Rear Split Bench Seat,Safety Features : Tow Hooks,Seats : Rear Bench Seat,Second Row Grab Handles,Securilock Anti-Theft Ignition (Pats),Tilt Steering Column", imagefront: nil, imageback: ni