Listing.where(title: "2006 Ford Mustang", description: "Make your statement in this beautiful muscle car! Our Clean Carfax 2006 Ford Mustang Standard has style to make bystanders stop and stare, shown in Vista Blue Metallic with the horsepower to turn their heads. Paying homage to the famed Mustangs of the 1960's with its big grille, round headlights, high-mounted fog lights and fastback roof line, this 4.0 Liter V6 powers out 210hp. Mated to a smooth shifting 5 Speed Automatic, our Rear Wheel Drive is ready to rumble!  The interior of our standard trim sports a lush cockpit of plush cloth and brushed aluminum. The 3-spoke sport steering wheel with cruise, the awesome stereo with CD player, and the power accessories add to the luxury. Go ahead and get comfy with the driver footrest, cruise control, and luxurious seats. This coupe is waiting for you to hop inside and make it purr.   Ford is known for keeping you and loved ones out of harm's way with equipment like 4-wheel disc brakes, airbags, and door beams for added security.This Ford Mustang is the longest surviving of the affordable breed of classic American muscle cars. No competition will be able to defeat this original muscle car in the hearts and minds of any true American. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2006, miles: 101941, transmission: "Automatic", color: "Vista Blue Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7995, newused: "Used", vin: "1ZVFT80N765157187", stocknumber: "CCSJ088", model: "Mustang", trim: "Standard", enginedescription: "4L 6 Cylinders", interiorcolor: "Dark Charcoal", options: "(2) Pwr Points,3-Point