Listing.where(title: "1997 Honda Accord Cpe", description: "One of America's traditional best-sellers, our One Owner Clean Carfax 1997 Honda Accord Coupe Special Edition is a fusion of engineering, good looks, quality and luxury. Honda's reliable 2.2L four cylinder powers your ride and it's easy on the gas, so you won't go broke keeping it filled! This 4 cylinder is a prime example of why Honda is famous for its smooth and long-lasting engines which squeeze every possible horsepower to make your drive more enjoyable.   Our truly affordable Accord is a roomy coupe, equipped with lots of great features that make it an attractive buy! With lots of amenities on board (Check out our gorgeous pictures!) you'll look forward to every ride in these comfortable Honda seats, savoring the fit and finish for which Honda is legendary!  This is a fabulous car at a great price, perfect for any chore, especially suitable for a new driver in your family. Whatever the need, this car at this price is your answer! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1997, miles: 114175, transmission: "Automatic", color: "San Marino Red", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4599, newused: "Used", vin: "1HGCD7202VA028618", stocknumber: "CCSJ118", model: "Accord Cpe", trim: "Special Edition", enginedescription: "2.2L 4 Cylinders", interiorcolor: "Gray", options: "Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Air Conditioning : A/C,Am/Fm Stereo W/Compact Disc Player,Convenience : Leather Steering Wheel,Convenience : Remote Trunk Release,Convenience : Security System,Convenience : Variable Speed Intermittent Wipers,Locks : Keyless Entry,Locks : Power Door Locks,Rear Window Defroster W/Timer,Reclining Front Buck