Listing.where(title: "2000 Honda CR-V", description: "Our 2000 Clean Carfax Honda CR-V EX 4WD is fun and family friendly! There's seating for five, all easily accessible and surprisingly roomy. Our Four Wheel Drive CR-V is powered by a 2.0 Liter, 4 Cylinder coupled with a responsive Automatic transmission for some driving fun while getting up to 25mpg on the highway. Take another look at the exterior, and you'll be able to see why everyone loves their CR-V so much!  As far as features go, this CR-V EX is nicely equipped! Climb aboard and enjoy comfortable seats while you let the air conditioning keep you in a cabin oasis. All the creature comforts you want and need are included; cruise control, keyless entry, power windows, locks, and exterior mirrors will keep you in the modern age. Tune into the AM/FM radio or pop in your favorite CD and you'll be cruising through the city streets in style!   Nobody wants to concern themselves with safety when they're behind the wheel. Rest easier knowing Honda has taken care of this for you. With anti-lock brakes, the confidence of four wheel drive, and an army of airbags, you and your loved ones will be out of harm's way. This is a well-designed, roomy vehicle that offers Honda quality and economy, while still boasting all the amenities desired in an SUV. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2000, miles: 160762, transmission: "Automatic", color: "Clover Green Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4999, newused: "Used", vin: "JHLRD1868YS020848", stocknumber: "HCSJ177", model: "CR-V", trim: "EX", enginedescription: "2L 4 Cylinders", interiorcol