Listing.where(title: "2010 Mazda Mazda3", description: "Our 2010 Mazda Mazda3 i Touring Sedan is more entertaining and sophisticated than you might think. Powered by a 2.0 Liter 4 Cylinder that produces 148hp while mated to a 5 Speed Automatic transmission for smooth shifts. This Front Wheel Drive i Touring will provide stability and traction while offering near 33mpg on the open road.   Climb in and enjoy the high-quality materials, comfortable seating, ample space, and easy-to-reach controls. You'll fall in love almost immediately when you settle into the cabin and bask in the spacious, luxurious nature of this sedan. Our i Touring sports a long list of options, like a multi-function steering wheel, and a great audio system complete with AM/FM/CD player, and an auxiliary audio jack.   There are plenty of safety features in place to ensure you are driving a secure car. Kudos to Mazda for delivering an even more polished version of what was already a highly refined and fun car. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years. Did you See the Sunroof?", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2010, miles: 115865, transmission: "Automatic", color: "Graphite Mica", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7995, newused: "Used", vin: "JM1BL1SG8A1180386", stocknumber: "BCSJ178", model: "Mazda3", trim: "i Touring", enginedescription: "2L 4 Cylinders", interiorcolor: "Black", options: "(2) 12-Volt Pwr Outlets,(3) Passenger Assist Grips,Anti-Lock Brake System W/Electronic Brakeforce Distribution (Ebd) & Brake Assist,Audio : Am/Fm Stereo,Audio : Auxiliary Audio Input,Audio : Cd Player,Audio : Mp3 Player,Convenience : Power Outlet,Convenience : Remote T