Listing.where(title: "2009 MINI Cooper Hardtop", description: "Our Clean Carfax 2009 MINI Cooper, shown in Sparkling Silver Metallic is a brilliant blend of great handling, efficiency, and stand-out style! This Front Wheel Drive subcompact delivers a fun, nimble, and energetic ride with its peppy 1.6 Liter 4 Cylinder that delivers 118hp. The fun to drive 6 Speed gearbox is highly responsive, scoring 37mpg highway. It is perfectly suited for city commutes, delivering a fun ride while saving money at the same time.The exterior boasts a rear spoiler, alloy wheels, and power door mirrors,  Everything about this Mini Cooper is wonderful! The looks are good, the style is fun, the interior is comfortable, the safety features are in place... Just one look at our pictures and you'll agree! Once inside you will be met with leatherette seating, panoramic sunroof a 6 speaker AM/FM/CD/MP3 Player radio data system, power accessories, and keyless entry. The gauges are the recognizable Mini Cooper style, BIG and easy to read.  The safety features include ABS, brake assist, stability control, low tire pressure warning, air bags, and more. Its small size, cargo versatility, and easy maneuverability make this 2009 Mini an ideal commuter car. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2009, miles: 76633, transmission: "Automatic", color: "Sparkling Silver Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7999, newused: "Used", vin: "WMWMF33569TW77863", stocknumber: "CCSJ188", model: "Cooper Hardtop", trim: nil, enginedescription: "1.6L 4 Cylinders", interiorcolor: "Grey/Carbon Black", options: "12V Auxiliary Pwr O