Listing.where(title: "2007 Nissan Xterra", description: "Our '07 Xterra is the genuine article: a real, Safari-grade adventure vehicle that can still handle everyday life on pavement with refinement and ease. Like its big brother, the Nissan Pathfinder, the Xterra is substantial, sophisticated, and refined. From its uncles, Titan and Armada, it has inherited a well-engineered, fully boxed ladder frame. Sophisticated electronics help maintain traction and stability over all kinds of uncertain terrain. Power comes via a 4.0-liter version of Nissan's acclaimed VQ V6 used in the 350Z, its fast living Nissan sister.  This Xterra is roomy inside, roomier than other SUVs in its class. It would work great for carrying four large adults and their gear into the backcountry. Second-row seating is stadium-style, meaning that the rear passengers can see over the front-seat occupants. This is an S trim model, so some extras are on board (in addition to the long list of standard features) including running boards and roof rack cross bars.   There is nothing else quite like an Xterra. It's in its element when used as a truck, a dirt-road prowler, or an adventure vehicle. It can handle wet or dirty cargo and clean up like a champ. Our '07 is considerable improved over pre-2005 models with more power, more room, and more carefully thought-out utility features. It's built on a rugged chassis. Yet it's more refined in every way, making it a much more practical everyday vehicle that you will enjoy 24/7/365. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! END OF MARCH BOTTOM LINE CASH DEALS PRICES EXPIRE APRIL 1ST NO FOOLIN", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2007, miles: 109597, transmission: "Automatic", color: "Maroon", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7999,