Listing.where(title: "2007 Toyota Highlander", description: "Meet our fabulous looking 2007 Toyota Highlander V6 in Stunning Super White. Powered by Toyota's proven 3.3 Liter V6 that offers 215hp while mated to a 5 Speed Automatic transmission for smooth shifts. This Front Wheel Drive provides a smooth ride while earning 25mpg on the highway. The exterior is enhanced with roof rails, a rear spoiler, and privacy glass.  Our Highlander V6 is loaded with features to make a daily errand or long trip equally enjoyable. The folding third-row seats help increase cargo space or seating as you need it. Take a look at the equipment list, and you will find comfortable seating, power accessories, cruise control, keyless entry, Navigation, power sunroof and an AM/FM with CD player for all your music possibilities. There's no shortage of conveniences to make you and your passengers happy.   Toyota included ABS, a myriad of airbags, traction/stability control, and 4-wheel disc brakes to help keep you safe and secure on the road. Our Toyota Highlander is an excellent choice for anyone needing a larger more efficient people and cargo mover. Come check it out today! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2007, miles: 122993, transmission: "Automatic", color: "Super White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7999, newused: "Used", vin: "JTEDP21A570137456", stocknumber: "CCSN48", model: "Highlander", trim: "w/3rd Row", enginedescription: "3.3L 6 Cylinders", interiorcolor: "Ash", options: "3-Point Seatbelts For All Seat Positions W/Drivers Emergency Locking Retractor (Elr), Automatic Locking Retractor (Alr)